class Solution:
    def removeDuplicates(self, s: str) -> str: # O( N | N )
        arr = list(s)
        stk = [arr.pop(0)]
        while arr:
            while stk and arr and arr[0] == stk[-1]: # keep taking out the same characters from the stk and first of arr 
                stk.pop()
                arr.pop(0)
            if arr:
                stk.append(arr.pop(0))
        
        return ''.join(stk)
    


